@telegram Feature idea: What about a function for sending messages at a specific time? For example:
I find an interesting link at 02:30 in the night and want to share it with a friend.
With that, I could send that message at 09:00 and not disturb my friends beauty sleep :-)

@janerikasplund @gregisenberg @telegram @discordapp @findyourislands @Nextdoor Nice analysis!

The group messaging networks lack the zero sum status transactions inevitable from a feed-driven UX. 

Feed-driven = broadcasting = competition for attention = zero sum status game

